pragma solidity ^0.4.24;

contract MyContract {
    uint256 public data;

    event LogChange(uint256 indexed _newData, address indexed _changer);

    constructor(uint256 _data) public {
        require(_data > 0, "Data should be greater than 0");
        data = _data;
    }

    function changeData(uint256 _newData) public {
        require(_newData > 0, "New data should be greater than 0");
        data = _newData;
        emit LogChange(_newData, msg.sender);
    }
}
```

This contract initializes with a value for `data` that must be more than 0. It allows anyone to change `data`, but only to a value greater than 0. It emits an event whenever `data` is changed, logging the new value and who changed it.
